import React, { Component } from 'react';

export default class CreateUser extends Component {
    render(){

        axios.post('http://localhost:7000/users/register', newUser)
        .then(res => console.log(res.data));
        return(
            <div>
                <h1 className="mt-4">Dashboard</h1>
                <p className="lead mb-3">Welcome You</p>

                <a href="/users/logout" className="btn btn-secondary">Logout</a>
                <a href="/newparty" className="btn btn-secondary">Create Party</a>
                <a href="/joinparty" className="btn btn-secondary">Join a Party</a>
            </div>
        )
    }
}
